import React from 'react';

export default props => {

	function userKey (){
		
	}

	return(
		<div className="container mt-5">
			<div className="row d-flex flex-row-reverse">
				<div className="col-md-6 d-flex flex-row-reverse">
					<div className="card col-12 p-0">
						<div className="card-header px-5">
							<div className="row">
								<div className="col">img</div>
								<div className="col">user info</div>
								<div className="col">out</div>
							</div>
						</div>
						{ props.data.map(item => {
							const userKey = "user-" + item.userId;
							console.log(userKey);
							return(
								<div className="card-body" key={item.id}>
									<div className="row">
										<div className="col-2 p-0 ml-3">
											img
										</div>
										<div className="col bg-secondary text-white mr-3 rounded">
											<div className="d-flex flex-column">
												<div className="row m-0">
													<div className="col p-0">
														{ item.userId }
													</div>
													<div className="col-3">
														
													</div>
												</div>
												<div>
													{ item.message }
												</div>
												<div>
													<span className="float-right">{ item.date }</span>
												</div>
											</div>
										</div>
									</div>
								</div>
							)
						})}
					</div>
				</div>
			</div>
		</div>
	)
}
